import {Modal } from './Modal';
import {useState} from 'react';

const Main = () => {
    const [showModal, setShowModal] = useState(false);
    const onDissmissModal = () => {
        setShowModal(false)
    }

    return(
        <>
        <div class="card">
        <div class="card-content">
          <h2>Form</h2>
          <button onClick={() => setShowModal(true)}class="btn">Open Form</button>
        </div>
      </div>
      { showModal && <Form dismissModal={onDissmissModal}/>}
        </>
        
    )
}

export default Main
